INSERT INTO `sys_dict_data` (`dict_code`, `dict_sort`, `dict_label`, `dict_value`, `dict_type`, `css_class`, `list_class`, `is_default`, `status`, `create_by`, `create_time`, `update_by`, `update_time`, `remark`) VALUES (47, 0, '虚报车辆类型', 'misreport_vehicle_type', 'cheating_type', NULL, 'danger', 'N', '0', 'admin', '2024-03-03 22:12:18', '', NULL, '虚报车辆类型：\n\n键值：misreport_vehicle_type\n描述：车辆主人或驾驶员故意提供虚假的车辆类型信息。\n行为特征：车辆主人或驾驶员错误地声称车辆的类型，以减少通行费用。\n潜在影响：导致通行费用不准确，损害公共利益和交通管理秩序。');
INSERT INTO `sys_dict_data` (`dict_code`, `dict_sort`, `dict_label`, `dict_value`, `dict_type`, `css_class`, `list_class`, `is_default`, `status`, `create_by`, `create_time`, `update_by`, `update_time`, `remark`) VALUES (48, 0, '无效车牌', 'invalid_license_plate', 'cheating_type', NULL, 'danger', 'N', '0', 'admin', '2024-03-03 22:12:43', '', NULL, '无效车牌：\n\n键值：invalid_license_plate\n描述：车辆使用无效或伪造的车牌。\n行为特征：车辆悬挂的车牌与法定要求不符或者是伪造的。\n潜在影响：难以对车辆进行追踪和管理，增加交通管理难度和风险。');
